@notice Allows users to add liquidity to the pool. Taxed tokens are not supported.
@dev Users should approve the tokens to this contract before calling this function.
@param recipient The address that will receive the newly minted LP tokens.

@notice Allows users to redeem their liquidity and receive the underlying tokens.
@dev Users should approve the LP tokens to this contract before calling this function.
@param recipient The address that will receive the redeemed tokens.
@return thisOut The amount of thisToken the recipient will receive.
@return thatOut The amount of thatToken the recipient will receive.

@notice Allows the caller to transfer excess thisToken or thatToken to a specified recipient.
@dev This function can be used to recover excess tokens of thisToken or thatToken sent to the contract.
@param token The address of the token (thisToken or thatToken) to be transferred.
@param recipient The address that will receive the excess tokens.

@notice Recovers tokens mistakenly sent to the Pool contract and sends them to the specified recipient.
@param token The address of the token to recover.
@param recipient The address of the recipient to receive the recovered tokens.
@dev Can only be called by the owner. Tokens specified as thisToken or thatToken cannot be recovered.

@notice This function allows for swapping of tokens using a specified routingAgent.
@param recipient The address to receive the swapped tokens.
@param routingAgent The address of the routingAgent contract.
@dev This function is non-reentrant to prevent re-entrancy attacks.

@notice This function allows for swapping of tokens with the proceeds allocated to the development fund.
@param recipient The address to receive the swapped tokens.
@dev This function is non-reentrant to prevent re-entrancy attacks.

@notice Internal function to swap tokens.
@param recipient The address to receive the swapped tokens.
@param routingAgent The address of the routingAgent contract.
@dev This function uses gas optimization techniques and updates the prices and balances based on the swapped amounts.

@title Pool
@notice The core Pool contract for the DEX system. It manages token swaps, liquidity provision,
and redemption of LP tokens for underlying assets. It uses the ReentrancyGuard to prevent
reentrancy attacks.
